import re

def parse_model_output(log: str) -> dict:
    pattern = ''
    match = re.match(pattern, log)
    if match:
        (epoch, iteration, training_id, best_f1, loss_dev, timestamp, precision, recall, f1) = match.groups()
        return {'epoch': int(epoch), 'iteration': int(iteration), 'training_id': training_id, 'best_f1': float(best_f1), 'loss_dev': float(loss_dev), 'timestamp': timestamp, 'precision': float(precision), 'recall': float(recall), 'f1': float(f1)}
    else:
        return {}

